import { Link } from 'react-router-dom';
import classes from './Post.module.css';
function Post(props){
    return (
    <li className={classes.post}>

        <p className={classes.author}>{props.author}</p>
        <p className={classes.text}>{props.body}</p>
    </li>
    );
}
export default Post;
